import React, { useState, useEffect } from 'react';

const ContractInput = ({ onContractChange, initialContract = '' }) => {
  // State for levels (1-7)
  const [level, setLevel] = useState('');
  // State for suits (♣, ♦, ♥, ♠, NT)
  const [suit, setSuit] = useState('');
  // State for declarer (N, E, S, W)
  const [declarer, setDeclarer] = useState('');
  // State for doubled status - initialize as undefined to ensure NO default selection
  const [doubled, setDoubled] = useState(undefined);
  
  // Parse initialContract if provided
  useEffect(() => {
    if (initialContract) {
      const contractMatch = initialContract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
      if (contractMatch) {
        setLevel(contractMatch[1]);
        setSuit(contractMatch[2]);
        setDeclarer(contractMatch[3]);
        setDoubled(contractMatch[4] || undefined);
      }
    }
  }, [initialContract]);
  
  // Update contract when any component changes
  useEffect(() => {
    if (level && suit && declarer) {
      // Only include doubled if it's defined (not undefined)
      const doubledPart = doubled !== undefined ? doubled : '';
      const newContract = `${level}${suit} ${declarer}${doubledPart}`;
      onContractChange(newContract);
    }
  }, [level, suit, declarer, doubled, onContractChange]);
  
  // Handle level selection
  const handleLevelClick = (selectedLevel) => {
    setLevel(selectedLevel);
  };
  
  // Handle suit selection
  const handleSuitClick = (selectedSuit) => {
    setSuit(selectedSuit);
  };
  
  // Handle declarer selection
  const handleDeclarerClick = (selectedDeclarer) => {
    setDeclarer(selectedDeclarer);
  };
  
  // Add console logging to debug
  useEffect(() => {
    console.log('Current doubled state:', doubled);
  }, [doubled]);
  
  return (
    <div className="contract-input-container">
      {/* Level Input */}
      <div className="level-suit-section">
        <div className="input-section-label">Level and Suit:</div>
        
        {/* Level Buttons (1-7) */}
        <div className="level-buttons">
          {[1, 2, 3, 4, 5, 6, 7].map((num) => (
            <button
              key={`level-${num}`}
              className={`level-btn ${level === num.toString() ? 'selected' : ''}`}
              onClick={() => handleLevelClick(num.toString())}
              data-level={num}
            >
              {num}
            </button>
          ))}
        </div>
        
        {/* Suit Buttons */}
        <div className="suit-buttons">
          {['♣', '♦', '♥', '♠', 'NT'].map((s) => (
            <button
              key={`suit-${s}`}
              className={`suit-btn ${suit === s ? 'selected' : ''}`}
              onClick={() => handleSuitClick(s)}
              data-suit={s}
            >
              {s}
            </button>
          ))}
        </div>
      </div>
      
      {/* Declarer Input */}
      <div className="declarer-section">
        <div className="input-section-label">Declarer:</div>
        <div className="declarer-buttons">
          {['N', 'S', 'E', 'W'].map((d) => (
            <button
              key={`declarer-${d}`}
              className={`declarer-btn ${declarer === d ? 'selected' : ''}`}
              onClick={() => handleDeclarerClick(d)}
            >
              {d}
            </button>
          ))}
        </div>
      </div>
      
      {/* Doubled Input - using raw HTML elements */}
      <div className="doubled-section">
        <div className="input-section-label">Doubled:</div>
        
        {/* Raw HTML without any classes */}
        <div style={{ display: 'flex', gap: '8px' }}>
          {/* None button */}
          <div 
            id="doubled-none"
            onClick={() => setDoubled('')}
            style={{
              flex: 1,
              height: '54px',
              border: doubled === '' ? '2px solid #3498db' : '1px solid #ddd',
              backgroundColor: doubled === '' ? '#3498db' : '#f8f8f8',
              color: doubled === '' ? 'white' : 'black',
              borderRadius: '8px',
              fontSize: '20px',
              fontWeight: 'bold',
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              userSelect: 'none'
            }}
          >
            -
          </div>
          
          {/* X button */}
          <div 
            id="doubled-x"
            onClick={() => setDoubled('X')}
            style={{
              flex: 1,
              height: '54px',
              border: doubled === 'X' ? '2px solid #3498db' : '1px solid #ddd',
              backgroundColor: doubled === 'X' ? '#3498db' : '#f8f8f8',
              color: doubled === 'X' ? 'white' : 'black',
              borderRadius: '8px',
              fontSize: '20px',
              fontWeight: 'bold',
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              userSelect: 'none'
            }}
          >
            X
          </div>
          
          {/* XX button */}
          <div 
            id="doubled-xx"
            onClick={() => setDoubled('XX')}
            style={{
              flex: 1,
              height: '54px',
              border: doubled === 'XX' ? '2px solid #3498db' : '1px solid #ddd',
              backgroundColor: doubled === 'XX' ? '#3498db' : '#f8f8f8',
              color: doubled === 'XX' ? 'white' : 'black',
              borderRadius: '8px',
              fontSize: '20px',
              fontWeight: 'bold',
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              userSelect: 'none'
            }}
          >
            XX
          </div>
        </div>
      </div>
    </div>
  );
};

export default ContractInput;
